func _mockHTTP(rsp []byte) (string, int) {
	addr := utils.GetRandomLocalAddr()
	time.Sleep(time.Second)
	var host, port, _ = utils.ParseStringToHostPort(addr)
	go func() {
		lis, err := net.Listen("tcp", addr)
		if err != nil {
			panic(err)
		}
		conn, err := lis.Accept()
		if err != nil {
			return
		}
		conn.Write(rsp)
		wait500ms()
		conn.Close()
		lis.Close()
	}()
	time.Sleep(time.Second)
	return host, port
}

func _fetchRawResponse(request []byte, addr string, tls bool) []byte {
	var conn net.Conn
	var err error
	if tls {
		conn, err = utils.GetAutoProxyConnWithTLS(addr, "", time.Second, utils.NewDefaultTLSConfig())
		if err != nil {
			panic(err)
		}
	} else {
		conn, err = utils.GetAutoProxyConn(addr, "", time.Second)
		if err != nil {
			panic(err)
		}
	}

	conn.Write(FixHTTPPacketCRLF(request, false))
	rsp := utils.StableReaderEx(conn, time.Second, 655350)
	return rsp
}

